import axios from "axios";
import { AuthData, FormAuthData } from "../signup";

// const client = axios.create({ baseURL: "http://localhost:3000/auth" });

export const signUp = async (data: AuthData) => {
  const res = axios.post("/signUp");
  return res;
};
